import React from "react";

const Variants = ({ vendor }) => {
  return (
    <div>
      {vendor.variant
        .map((item) => {
          const variantValues = Object.entries(item).map(
            ([key, value]) => `${value}`
          );
          return variantValues.join(" : ");
        })
        .join(", ")}
    </div>
  );
};

export default Variants;
